INSERT INTO `aos_pdf_templates` VALUES ('309fcb0e-4c90-bdb7-194a-53bb2606e82d','Business Case','2014-07-07 23:01:05','2014-07-07 23:01:30','1','1','<table style=\"width: 100%;\" border=\"0\" cellspacing=\"2\" cellpadding=\"2\">\r\n<tbody style=\"text-align: left;\">\r\n<tr>\r\n<td valign=\"top\">\r\n<p><img style=\"float: left;\" src=\"custom/themes/default/images/company_logo.png\" alt=\"\" /></p>\r\n</td>\r\n<td style=\"font-weight: bold; text-align: right;\">\r\n<div>SelkirkCRM Ltd<br />Any Street<br />Any Town<br />Any Where</div>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<div></div>\r\n<div>$accounts_name<br /> $accounts_billing_address_street<br /> $accounts_billing_address_city<br /> $accounts_billing_address_state<br /> $accounts_billing_address_postalcode</div>\r\n<div></div>\r\n<div>{DATE m/d/Y}</div>\r\n<div></div>\r\n<p>Dear $accounts_name</p>\r\n<p>OpenSales was originally designed and conceived by Rustin Phares. In 2009, when Rustin could no longer devote time to the project, which is an important one for the Community Edition of SugarCRM, SalesAgility approached him to seek permission to pick up where he had left off.</p>\r\n<p>In early 2010 we released the first iteration of what was now to be called \"Advanced OpenSales\". Since then there have been regular releases to bring Advanced OpenSales into line with the latest releases of SugarCRM and to advance the functionality.</p>\r\n<p>2011 saw a complete rewrite of Advanced OpenSales to bring it into line with the 5.x and 6.x architectures and the introduction of an Invoice module. In March 2011, an Invoicing module for SugarCRM Professional Edition was also released.</p>\r\n<p>Advanced OpenSales is released under the Affero General Purpose License meaning it\'s Open Source and freely available. That does not mean that there is no cost involved in making it. Thousands of man hours have gone in to developing and maintaining these modules. Any contributions that assist us in keeping the project on an even keel are gratefully received.</p>\r\n<p>SalesAgility are SugarCRM experts. With offices in Manchester and Central Scotland, we\'re ideally placed to serve your SugarCRM requirements. As consultants, we design and implement tailored Sugar CRM instances. As software developers, we design and deliver customised instances of Sugar CRM that meet the more specialist needs of our clients. As a support organisation we deliver training, hosting and help-desk services to ensure that our clients continue to get best value from their Sugar investment.</p>\r\n<p>Yours sincerely</p>\r\n<p>$modified_by_name_user_name</p>\r\n<p></p>\r\n<p>Someone</p>',1,'1',0,'Accounts','','',15,15,16,16,9,9);
/*!40000 ALTER TABLE `aos_pdf_templates` ENABLE KEYS */;
UNLOCK TABLES;

