INSERT INTO `sel_selkirk_business_case` VALUES ('7d611cbd-98b0-9ff3-64bf-538f99614e2f','sdfadfa','2014-06-04 22:10:50','2014-06-05 18:40:04','1','1','',1,'1',NULL,'','','','','','','','','','','yes',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),('a1619246-ba45-ed20-2635-5390b996dc26','ADT Phase 3','2014-06-05 18:40:47','2014-06-09 20:17:15','57467e79-effc-821e-84ea-5390f00a8646','1','',1,'1',NULL,'','','','','','','','','','','yes','',NULL,'','','','','','','','','',''),('a9cf9236-3319-7a69-7eb3-53bab9e0362f','Selkirk-SME Applied Research & Technology Solutions (ARTS) Project ','2014-07-07 15:13:59','2014-07-07 15:55:01','a313c2d7-9bd8-d699-929f-537b79ba4db8','a313c2d7-9bd8-d699-929f-537b79ba4db8','The Selkirk-SME Applied Research & Technology Solutions (ARTS) project will help accelerate SME innovation by providing companies with access to college faculty and student support primarily in the areas of digital fabrication and geospatial technologies.  Faculty will engage in outreach and consultations to identify possible projects, secure required resources, and provide direct ARTS support to SMEs.',0,'a313c2d7-9bd8-d699-929f-537b79ba4db8',NULL,'SGRC','The following objectives will guide this project:\n	Engage in outreach and consultations with SMEs to identify possible ARTS projects; \n	Develop project plans and related funding proposals to support identified ARTS project; and\n	Provide direct ARTS support to SMEs primarily in the areas of digital fabrication and geospatial technologies\n',NULL,'This project builds on the successful NRC-funded ADT project: it will provide 22 months of NRC-IRAP funding for SGRC & Digitial Media outreach & project development with SMEs in the region.   This will help Selkirk develop its appliead research and innovation capacity.',NULL,'Most federal applied research  funding opportunities for Canadian Colleges require that we work in partnership with small and medium-sized enterprizes (SMEs).   Selkirk has limited experience in  engaging SMEs in collaborative research and development projects: although we have collaborated with some SMEs (for instance, the SGRC has worked with forest licensees, and the School of Digital Media has worked with some manufacturees), the National Research Council (NRC)-funded ADT project was one of our first attempts to systematically engage regional SMEs.   This project builds on the successes of the ADT project but is more focused: here the objective is to concentrate on connecting business with existing areas of applied research and innovation (ARI) expertise at the College in the SGRC and Digital Media.','The Selkirk-SME Applied Research & Technology Solutions (ARTS) project will help accelerate SME innovation by providing companies with access to college faculty and student support primarily in the areas of digital fabrication and geospatial technologies.  Faculty will engage in outreach and consultations to identify possible projects, secure required resources, and provide direct ARTS support to SMEs.\n\nThe following objectives will guide this project:\n	Engage in outreach and consultations with SMEs to identify possible ARTS projects; \n	Develop project plans and related funding proposals to support identified ARTS project; and\n	Provide direct ARTS support to SMEs primarily in the areas of digital fabrication and geospatial technologies.\n\nFunding from the National Research Council (NRC) will provide Selkirk College with the resources needed to effectively support SME innovation through direct support and related activities, including SME consultation and project scoping and proposal development to secure external funding (i.e. IRAP, Business Innovation Access Program).   Without NRC funding, linkages between SMEs and College expertise will remain limited.  NRC funding will not only support project and funding proposal development, but will also support project implementation in cases where external funding is unavailable.\n','We assume that there are SMEs in the region that would benefit from collaborative R&D with Selkirk\r\nWe assume that Selkirk will benefit through improved service to community, and through improvements to teaching (by keeping faculty and staff at the leading edge of their fields) and learning (by providing applied research opportunities for students and by bringing current R&D into the classroom).\r\nNRC assumes that Selkirk will use this funding to develop capacity to work with SMEs and to identify other funding opportunities to sustain on going R&D.','This project is expected to run from August 15, 2014, to June 30, 2016.  ','June 2015:  Is Selkirk ready to prepare a major funding application to NSERC (for instance for a Technology Access Centre -TAC).','yes','This project primarily aligns with Selkirk\'s third pillar of success:  Community Engagement & Innovation.   It also supports Teaching Excellence (through faculty professional development through R&D activity) and Focus on the Learner (by bringing ARI into the classroom, and by potentially providing student intern opportunities).',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),('c86db1f5-f368-03a1-108f-53960c7073b7','Supporting the Regional Food System and Agricultural Land Use Planning in the Columbia Basin-Boundary Region','2014-06-09 19:33:41','2014-06-13 19:00:56','1','57467e79-effc-821e-84ea-5390f00a8646',NULL,0,'57467e79-effc-821e-84ea-5390f00a8646','2014-06-09','RDI',NULL,NULL,NULL,NULL,'There are many stakeholders in the region working on some aspect of the regional food system, including but not limited to agricultural societies, local government, farmers, and the Columbia Basin Trust.  A significant amount of research has been conducted and a number of agricultural plans are in place.  The current situation is also affected by changes to the Agricultural Land Reserve (ALR).  There is a need to better understand the food systems landscape on a regional scale and to better understand challenges and opportunities of our regional food system.','The Regional Food Systems Project is focused on providing information to support food-systems related land use planning in the Columbia Basin Boundary region of BC.  The Regional Food System Project will:\n	Explore the landscape of food-security related research, plans and networks in the region;\n	Map food-security related land, assets and indicators;\n	Identify opportunities and challenges within the key elements of the regions food system;\n	Identify gaps and bottlenecks within the supply chain of up to 5 prioritized food products; and \n	Create opportunities for a discussion of key findings, recommendations and next steps.\n','The key assumption is that the RDI will work in collaboration with the Columbia Basin Trust\'s Special Initiatives department.  CBT is exploring their future role in supporting our regional food system.  RDI researchers have already liaised with their consultant who will have a background paper complete by end of September.  CBT also plans to pull together a regional advisory group that RDI could assess for this project.','This project relies on funding from the BC Real Estate Foundation.  A decision is expected in September.  The Fall / Winter timing is good for this type of research project as the RDI team anticipates it will be difficult to access agricultural stakeholders during the summer months (growing season).','Key project deliverables include:\n	Existing food-security related research and plans on/from our region consolidated and made available in one place on the searchable RDI Resources Database\n	Mapping of existing food security groups as assets on the Digital Basin portal\n	A report that summarizes existing food security-related research and plans in the region and includes the identification of common themes and research gaps\n	The addition of a suite of food security assets and indicators on the Digital Basin portal including a Productive Farm Lands layer\n	The identification of challenges and opportunities with the key elements of our regional food system (i.e. production inputs, farming & food production; food processing; distribution & storage; retail & consumption; and waste management)\n	The identification of possible regional target crops and products, and the identification of related farm lands that could benefit from a finer level of analysis using a proposed remote sensing methodology \n	The identification of gaps and bottlenecks in the supply chain of prioritized regional agricultural products\n	A series of knowledge mobilization products (i.e. trends analysis brief, knowledge brief, workshop content and materials, video)\n- presentations to Regional Districts\n','yes','Selkirk College Plan - Expand our impact on community development and innovation\r\nRDI Strategic Plan - Undertake applied rural development focused research\r\nThis project supports the above by engaging in applied rural development focused research in a way that expands Selkirk College\'s impact on community development and innovation.',NULL,'This will primarily bring additional $ to SGRC to allow their staffing levels to remain stable.','Seeking $50K from the Real Estate Foundation to match with $50K from RDI CBT funding.  This will help with costs needed for additional research support and SGRC mapping elements.','This project will involve the addition of new layers to the Digital Basin.  Data layer refresh work will likely occur annually.  This will need to be reflected in the annual Digital Basin maintenance plan for future years.','It is not anticipated that any new staff will need to be hired to support this project.','$50K from BC REF\r\n$50K from CBT RDI budget\r\n$16K in-kind RIC and project advisors\r\n$15K in-kind admin and overhead (',NULL,'This is not a profit making exercise for the college it is service to communities and fulfilling the RDI\'s mandate.  Institutional overhead is included in the RDI budget.\r\nHow do estimate the $ benefit related to service to communities?','This project seeks additional funds to leverage CBT dollars for applied research.  It allows for an expanded scope of food systems related research.  Doing nothing or status quo will impact the extent to which the RDI can serve communities.','Not effectively collaborating with CBT and as a result duplicating efforts.  Ensuring scope of research project is informed by the annual RDI work plan and existing capacities of both SGRC and RDI teams.','Refresh to data layers in the Digital Basin.  Possible future research and / or development work based on the findings.  The findings will also be useful to CBT in their efforts to better understand if and how they could support our regional food system in future years.');
