INSERT INTO `sel_selkirk_business_case_audit` VALUES ('12ca1b50-fbfd-fabc-56fe-53bac26159ca','a9cf9236-3319-7a69-7eb3-53bab9e0362f','2014-07-07 15:55:01','a313c2d7-9bd8-d699-929f-537b79ba4db8','project_description','text',NULL,NULL,'The Selkirk-SME Applied Research & Technology Solutions (ARTS) project will help accelerate SME innovation by providing companies with access to college faculty and student support primarily in the areas of digital fabrication and geospatial technologies.  Faculty will engage in outreach and consultations to identify possible projects, secure required resources, and provide direct ARTS support to SMEs.\n\nThe following objectives will guide this project:\n	Engage in outreach and consultations with SMEs to identify possible ARTS projects; \n	Develop project plans and related funding proposals to support identified ARTS project; and\n	Provide direct ARTS support to SMEs primarily in the areas of digital fabrication and geospatial technologies.\n\nFunding from the National Research Council (NRC) will provide Selkirk College with the resources needed to effectively support SME innovation through direct support and related activities, including SME consultation and project scoping and proposal development to secure external funding (i.e. IRAP, Business Innovation Access Program).   Without NRC funding, linkages between SMEs and College expertise will remain limited.  NRC funding will not only support project and funding proposal development, but will also support project implementation in cases where external funding is unavailable.\n','The Selkirk-SME Applied Research & Technology Solutions (ARTS) project will help accelerate SME innovation by providing companies with access to college faculty and student support primarily in the areas of digital fabrication and geospatial technologies.  Faculty will engage in outreach and consultations to identify possible projects, secure required resources, and provide direct ARTS support to SMEs.\n\nThe following objectives will guide this project:\n	Engage in outreach and consultations with SMEs to identify possible ARTS projects; \n	Develop project plans and related funding proposals to support identified ARTS project; and\n	Provide direct ARTS support to SMEs primarily in the areas of digital fabrication and geospatial technologies.\n\nFunding from the National Research Council (NRC) will provide Selkirk College with the resources needed to effectively support SME innovation through direct support and related activities, including SME consultation and project scoping and proposal development to secure external funding (i.e. IRAP, Business Innovation Access Program).   Without NRC funding, linkages between SMEs and College expertise will remain limited.  NRC funding will not only support project and funding proposal development, but will also support project implementation in cases where external funding is unavailable.\n'),('133eadae-5178-43a2-f51a-53bac2fcacc8','a9cf9236-3319-7a69-7eb3-53bab9e0362f','2014-07-07 15:55:01','a313c2d7-9bd8-d699-929f-537b79ba4db8','strategic_alignment','text',NULL,NULL,NULL,'This project primarily aligns with Selkirk\'s third pillar of success:  Community Engagement & Innovation.   It also supports Teaching Excellence (through faculty professional development through R&D activity) and Focus on the Learner (by bringing ARI into the classroom, and by potentially providing student intern opportunities).'),('1fb5e9db-7d0e-e2a1-04cd-539b4a5658b0','c86db1f5-f368-03a1-108f-53960c7073b7','2014-06-13 19:00:56','1','major_project_milestones','text',NULL,NULL,'Key project deliverables include:\n	Existing food-security related research and plans on/from our region consolidated and made available in one place on the searchable RDI Resources Database\n	Mapping of existing food security groups as assets on the Digital Basin portal\n	A report that summarizes existing food security-related research and plans in the region and includes the identifica