egional agricultural products\n	A series of knowledge mobilization products (i.e. trends analysis brief, knowledge brief, workshop content and materials, video)\n- presentations to Regional Districts\n'),('31960c00-9145-298b-bf16-539b455a1c40','c86db1f5-f368-03a1-108f-53960c7073b7','2014-06-13 18:39:51','1','major_project_milestones','text',NULL,NULL,'Key project deliverables include:\n	Existing food-security related research and plans on/from our region consolidated and made available in one place on the searchable RDI Resources Database\n	Mapping of existing food security groups as assets on the Digital Basin portal\n	A report that summarizes existing food security-related research and plans in the region and includes the identification of common themes and research gaps\n	The addition of a suite of food security assets and indicators on the Digital Basin portal including a Productive Farm Lands layer\n	The identification of challenges and opportunities with the key elements of our regional food system (i.e. production inputs, farming & food production; food processing; distribution & storage; retail & consumption; and waste management)\n	The identification of possible regional target crops and products, and the identification of related farm lands that could benefit from a finer level of analysis using a proposed remote sensing methodology \n	The identification of gaps and bottlenecks in the supply chain of prioritized regional agricultural products\n	A series of knowledge mobilization products (i.e. trends analysis brief, knowledge brief, workshop content and materials, video)\n- presentations to Regional Districts\n','Key project deliverables include:\n	Existing food-security related research and plans on/from our region consolidated and made available in one place on the searchable RDI Resources Database\n	Mapping of existing food security groups as assets on the Digital Basin portal\n	A report that summarizes existing food security-related research and plans in the region and includes the identification of common themes and research gaps\n	The addition of a suite of food security assets and indicators on the Digital Basin portal including a Productive Farm Lands layer\n	The identification of challenges and opportunities with the key elements of our regional food system (i.e. production inputs, farming & food production; food processing; distribution & storage; retail & consumption; and waste management)\n	The identification of possible regional target crops and products, and the identification of related farm lands that could benefit from a finer level of analysis using a proposed remote sensing methodology \n	The identification of gaps and bottlenecks in the supply chain of prioritized regional agricultural products\n	A series of knowledge mobilization products (i.e. trends analysis brief, knowledge brief, workshop content and materials, video)\n- presentations to Regional Districts\n'),('36c4fd91-6b0b-f3fb-df59-53babdccb078','a9cf9236-3319-7a69-7eb3-53bab9e0362f','2014-07-07 15:33:15','a313c2d7-9bd8-d699-929f-537b79ba4db8','description','text',NULL,NULL,'','The Selkirk-SME Applied Research & Technology Solutions (ARTS) project will help accelerate SME innovation by providing companies with access to college faculty and student support primarily in the areas of digital fabrication and geospatial technologies.  Faculty will engage in outreach and consultations to identify possible projects, secure required resources, and provide direct ARTS support to SMEs.'),('372466e6-650a-1039-96cf-53babd061dc2','a9cf9236-3319-7a69-7eb3-53bab9e0362f','2014-07-07 15:33:15','a313c2d7-9bd8-d699-929f-537b79ba4db8','anticipated_outcomes','text',NULL,NULL,'','The following objectives will guide this project:\n	Engage in outreach and consultations with SMEs to identify possible ARTS projects; \n	Develop project plans and related funding proposals to support identified ARTS project; and\n	Provide direct ARTS support to SMEs primarily in the areas of digital fabrication and geospatial technologies\n'),('376d54d4-be99-0fe6-387f-53babd0b1449','a9cf9236-3319-7a69-7eb3-53bab9e0362f','2014-07-07 15:33:15','a313c2d7-9bd8-d699-929f-537b79ba4db8','justification','text',NULL,NULL,'','This project builds on the successful NRC-funded ADT project: it will provide 22 months of NRC-IRAP funding for SGRC & Digitial Media outreach & project development with SMEs in the region.   This will help Selkirk develop its appliead research and innovation capacity.'),('80cce0a8-a8cc-186d-1890-539b39bb71f8','c86db1f5-f368-03a1-108f-53960c7073b7','2014-06-13 17:46:49','1','major_project_milestones','text',NULL,NULL,'Key project deliverables include:\n	Existing food-security related research and plans on/from our region consolidated and made available in one place on the searchable RDI Resources Database\n	Mapping of existing food security groups as assets on the Digital Basin portal\n	A report that summarizes existing food security-related research and plans in the region and includes the identification of common themes and research gaps\n	The addition of a suite of food security assets and indicators on the Digital Basin portal including a Productive Farm Lands layer\n	The identification of challenges and opportunities with the key elements of our regional food system (i.e. production inputs, farming & food production; food processing; distribution & storage; retail & consumption; and waste management)\n	The identification of possible regional target crops and products, and the identification of related farm lands that could benefit from a finer level of analysis using a proposed remote sensing methodology \n	The identification of gaps and bottlenecks in the supply chain of prioritized regional agricultural products\n	A series of knowledge mobilization products (i.e. trends analysis brief, knowledge brief, workshop content and materials, video)\n- presentations to Regional Districts\n','Key project deliverables include:\n	Existing food-security related research and plans on/from our region consolidated and made available in one place on the searchable RDI Resources Database\n	Mapping of existing food security groups as assets on the Digital Basin portal\n	A report that summarizes existing food security-related research and plans in the region and includes the identification of common themes and research gaps\n	The addition of a suite of food security assets and indicators on the Digital Basin portal including a Productive Farm Lands layer\n	The identification of challenges and opportunities with the key elements of our regional food system (i.e. production inputs, farming & food production; food processing; distribution & storage; retail & consumption; and waste management)\n	The identification of possible regional target crops and products, and the identification of related farm lands that could benefit from a finer level of analysis using a proposed remote sensing methodology \n	The identification of gaps and bottlenecks in the supply chain of prioritized regional agricultural products\n	A series of knowledge mobilization products (i.e. trends analysis brief, knowledge brief, workshop content and materials, video)\n- presentations to Regional Districts\n'),('90a7c98f-f147-6a59-44e4-53bac1b63287','a9cf9236-3319-7a69-7eb3-53bab9e0362f','2014-07-07 15:50:32','a313c2d7-9bd8-d699-929f-537b79ba4db8','current_situation','text',NULL,NULL,NULL,'Most federal applied research  funding opportunities for Canadian Colleges require that we work in partnership with small and medium-sized enterprizes (SMEs).   Selkirk has limited experience in  engaging SMEs in collaborative research and development projects: although we have collaborated with some SMEs (for instance, the SGRC has worked with forest licensees, and the School of Digital Media has worked with some manufacturees), the National Research Council (NRC)-funded ADT project was one of our first attempts to systematically engage regional SMEs.   This project builds on the successes of the ADT project but is more focused: here the objective is to concentrate on connecting business with existing areas of applied research and innovation (ARI) expertise at the College in the SGRC and Digital Media.'),('90fa8411-21da-dd2a-49a4-53bac1b3b903','a9cf9236-3319-7a69-7eb3-53bab9e0362f','2014-07-07 15:50:32','a313c2d7-9bd8-d699-929f-537b79ba4db8','project_description','text',NULL,NULL,NULL,'The Selkirk-SME Applied Research & Technology Solutions (ARTS) project will help accelerate SME innovation by providing companies with access to college faculty and student support primarily in the areas of digital fabrication and geospatial technologies.  Faculty will engage in outreach and consultations to identify possible projects, secure required resources, and provide direct ARTS support to SMEs.\n\nThe following objectives will guide this project:\n	Engage in outreach and consultations with SMEs to identify possible ARTS projects; \n	Develop project plans and related funding proposals to support identified ARTS project; and\n	Provide direct ARTS support to SMEs primarily in the areas of digital fabrication and geospatial technologies.\n\nFunding from the National Research Council (NRC) will provide Selkirk College with the resources needed to effectively support SME innovation through direct support and related activities, including SME consultation and project scoping and proposal development to secure external funding (i.e. IRAP, Business Innovation Access Program).   Without NRC funding, linkages between SMEs and College expertise will remain limited.  NRC funding will not only support project and funding proposal development, but will also support project implementation in cases where external funding is unavailable.\n'),('9146f1f3-8d46-ba28-e550-53bac1158cb6','a9cf9236-3319-7a69-7eb3-53bab9e0362f','2014-07-07 15:50:32','a313c2d7-9bd8-d699-929f-537b79ba4db8','project_assumptions','text',NULL,NULL,NULL,'We assume that there are SMEs in the region that would benefit from collaborative R&D with Selkirk\r\nWe assume that Selkirk will benefit through improved service to community, and through improvements to teaching (by keeping faculty and staff at the leading edge of their fields) and learning (by providing applied research opportunities for students and by bringing current R&D into the classroom).\r\nNRC assumes that Selkirk will use this funding to develop capacity to work with SMEs and to identify other funding opportunities to sustain on going R&D.'),('91932e68-cc41-4f0c-4391-53bac18628dd','a9cf9236-3319-7a69-7eb3-53bab9e0362f','2014-07-07 15:50:32','a313c2d7-9bd8-d699-929f-537b79ba4db8','project_constraints','text',NULL,NULL,NULL,'This project is expected to run from August 15, 2014, to June 30, 2016.  '),('91df6cd1-a1ed-f6a4-4f1a-53bac1b5bb74','a9cf9236-3319-7a69-7eb3-53bab9e0362f','2014-07-07 15:50:32','a313c2d7-9bd8-d699-929f-537b79ba4db8','major_project_milestones','text',NULL,NULL,NULL,'June 2015:  Is Selkirk ready to prepare a major funding application to NSERC (for instance for a Technology Access Centre -TAC).');
